import styled from "styled-components";

export const FooterContainer = styled.div`
  padding: 88px 0 51px;
  background-color: #1A1A25;
`;

export const FooterBottom = styled.div`
  position: relative;
  padding-top: 51px;

  &::before {
    content: '';
    position: absolute;
    top: -1px;
    left: 0;
    display: block;
    width: 100%;
    height: 1px;
    background: rgba(133, 143, 164, 0.15);
    border-radius: 1px;
  }
`;

export const FooterTop = styled.div``;
